# Instantiate and deploy contract
Payable = platon.wasmcontract(abi=abi, bytecode=bytecode,vmtype=1)

tx_hash = Payable.constructor().transact(
    {
        'from':from_address,
        'gas':1500000,
    }
)
# Wait for the transaction to be mined, and get the transaction receipt
tx_receipt = platon.waitForTransactionReceipt(tx_hash)

# Create the contract instance with the newly-deployed address
greeter = platon.wasmcontract(address=tx_receipt.contractAddress, abi=abi,vmtype=1)

tx_hash = greeter.functions.setUint8(100).transact(
    {
        'from': from_address,
        'gas': 1500000,
    }
)

tx_receipt = platon.waitForTransactionReceipt(tx_hash)
print(tx_receipt)

topic_param = greeter.events.transfer().processReceipt(tx_receipt)
print(topic_param)
